import React, { useState, useEffect } from 'react';
import { getEvents } from '../../fetch';

import BookingCalendar from 'react-booking-calendar';
import { CalendarWrapper, Container } from './hausboot-rot.styles';

const HausbootRot = () => {
	const bookings = [new Date(getEvents((events) => events[0].start)), new Date('2021-05-10')];

	useEffect(() => {
		getEvents((events) => setState(events.map((event) => event.start.join(' '))));
	}, []);
	const [state, setState] = useState(null);
	return (
		<div>
			<Container>
				<CalendarWrapper>
					<BookingCalendar bookings={bookings} disableHistory />
					<div>Test: {state}</div>
				</CalendarWrapper>
			</Container>
		</div>
	);
};

export default HausbootRot;
